import Link from 'next/link';

const linkStyle = {
  marginRight: 500,
};

const Header = () => (
  <div>
    <h2>LETIŠTĚ CHRAST</h2>
    <img src="/logo_let.png" alt="logo" />
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
  </div>
   
);

export default Header;
